import React from "react"
import {useStyle} from './useStyle'


export const Home = ({images}) => {
    const classes = useStyle();
    return (
        <div className={classes.root}>
            {images.map(img => (
                <img key={img} src={img} alt=""/>
            ))}
        </div>
    )
};
